  `qtd` varchar(10) COLLATE latin1_general_ci NOT NULL,
  `ncm` varchar(10) COLLATE latin1_general_ci NOT NULL,
  `modelo` varchar(10) COLLATE latin1_general_ci NOT NULL,
  `lancamento` varchar(1) COLLATE latin1_general_ci NOT NULL,
  `site` int COLLATE latin1_general_ci NOT NULL,
  `ean` varchar(10) COLLATE latin1_general_ci NOT NULL,
